import React from 'react';
import Hero from '../ChildComponents/Hero'

function WelcomePage( props ){
  return(
    <div>
      <p>{ props.title }</p>
      <p>{ props.subtitle }</p>
      <Hero title={ props.title } subtitle></Hero>
    </div>
  )
}
export default WelcomePage
